import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import Welcome from './Welcome';
import DisplayQuestions from './DisplayQuestions';
import { QuestionsProvider, useQuestions } from './QuestionsContext'; // Ensure this component is correctly defined

function App() {
  return (
    <QuestionsProvider> 
    <Router>
      <div className="App">
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/questions">Display Questions</Link>
            </li>
          </ul>
        </nav>
        <Routes>
          <Route path="/" element={<Welcome />} exact />
          <Route path="/questions" element={<DisplayQuestions />} />
        </Routes>
      </div>
    </Router>
    </QuestionsProvider>
  );
}

export default App;
